import Sql2009 from './Sql2009';
import Sql2008 from './Sql2008';
import Sql2007 from './Sql2007';
import Sql2006 from './Sql2006';
import Sql2005 from './Sql2005';
import Sql2004 from './Sql2004';
import Sql2003 from './Sql2003';
import Sql2002 from './Sql2002';
import Sql2001 from './Sql2001';
import SU from './SU';
import CU from './CU';
import FIXErrors from './FIXErrors';




// // import Selectbox from './Testing';



function App() {
  return (
<Router>

<Header/>

      <Routes>
        <Route exact path="/" element={<Radiobutton/>} />
        <Route exact path="/Dropdownbox" element={<Dropdownbox/>} />
        <Route exact path="/Sql2022" element={<Sql2022/>} />
        <Route  exact path="/Sql2021" element={<Sql2021/>} />
        <Route  exact path="/Sql2020" element={<Sql2020/>} />
        <Route  exact path="/Sql2019" element={<Sql2019/>} />
        <Route  exact path="/Sql2018" element={<Sql2018/>} />
        <Route  exact path="/Sql2017" element={<Sql2017/>} />
        <Route  exact path="/Sql2016" element={<Sql2016/>} />
        <Route  exact path="/Sql2015" element={<Sql2015/>} />
        <Route  exact path="/Sql2014" element={<Sql2014/>} />
        <Route  exact path="/Sql2013" element={<Sql2013/>} />
        <Route  exact path="/Sql2012" element={<Sql2012/>} />
        <Route  exact path="/Sql2011" element={<Sql2011/>} />
        <Route  exact path="/Sql2010" element={<Sql2010/>} />
        <Route  exact path="/Sql2009" element={<Sql2009/>} />
        <Route  exact path="/Sql2008" element={<Sql2008/>} />
        <Route  exact path="/Sql2007" element={<Sql2007/>} />
        <Route  exact path="/Sql2006" element={<Sql2006/>} />
        <Route  exact path="/Sql2005" element={<Sql2005/>} />
        <Route  exact path="/Sql2004" element={<Sql2004/>} />
        <Route  exact path="/Sql2003" element={<Sql2003/>} />
        <Route  exact path="/Sql2002" element={<Sql2002/>} />
        <Route  exact path="/Sql2001" element={<Sql2001/>} />      
        <Route  exact path="/SU" element={<SU/>} />    
        <Route  exact path="/CU" element={<CU/>} />  
        <Route  exact path="/FIXErrors" element={<FIXErrors/>} />
      </Routes>
<Dropdownbox/>

<Footer/> 

{/* <Navbar/>

<Radiobutton/>

<Dropdownbox/>

<Table/> */}

{/* <Footer/> */}

{/* <Routes>
<Route path="/" element ={<Radiobutton/>} >
  <Route path="/Home" element ={<Home/>} />
</Route>
</Routes> */}

    {/* <Dropdownbox/>  */}

</Router>


    );


}

export default App;



























































